import React, { Component } from "react";
import { Container } from "reactstrap"
import { connect } from "react-redux";
import { updateStats, getStats } from "../actions/transactionActions"
import PropTypes from "prop-types"

class TransactionStats extends Component {
    render(){
        return(
            <Container>
                <div className="stats-wrapper">
                    <div className="stats-income">
                    ${this.props.transaction.income}
                    </div>
                    <div className="stats-remainder">
                        ${this.props.transaction.remainder}
                    </div>
                </div>
            </Container>
        )
    }
}



TransactionStats.propTypes = {
    getTransactions: PropTypes.func.isRequired,
    transaction: PropTypes.object.isRequired,
    income: PropTypes.number,
    remainder: PropTypes.number

}

const mapStateToProps = state => ({
    transaction: state.transaction,
    income: state.income,
    remainder: state.remainder
})

export default connect(mapStateToProps, { updateStats, getStats })(TransactionStats)
